"Fructose is a levorotatory monosaccharide and an isomer of glucose.  Although fructose is a hexose (6 carbon sugar), it generally exists as a 5-member hemiketal ring (a furanose) [ChEBI]. A monosaccharide in sweet fruits and honey that is soluble in water, alcohol, or ether. It is used as a preservative and an intravenous infusion in parenteral feeding [MeSH].", 
"Sucrose is a disaccharide formed by glucose and fructose units joined by an acetal oxygen bridge from hemiacetal of glucose to the hemiketal of the fructose [ChEBI]. A nonreducing disaccharide composed of GLUCOSE and FRUCTOSE linked via their anomeric carbons. It is obtained commercially from SUGARCANE, sugar beet (BETA VULGARIS), and other plants and used extensively as a food and a sweetener [MeSH].", 
"The simplest member of the class of propane-1,2-diols, consisting of propane in which a hydrogen at position 1 and a hydrogen at position 2 are substituted by hydroxy groups. A colourless, viscous, hygroscopic, low-melting (-59degreeC) and high-boiling (188degreeC) liquid with low toxicity, it is used as a solvent, emulsifying agent, and antifreeze [ChEBI]. A clear, colorless, viscous organic solvent and diluent used in pharmaceutical preparations [MeSH].", 
"A C21-steroid hormone in which a pregnane skeleton carries oxo substituents at positions 3 and 20 and is unsaturated at C(4)-C(5). As a hormone, it is involved in the female menstrual cycle, pregnancy and embryogenesis of humans and other species [ChEBI]. The major progestational steroid that is secreted primarily by the CORPUS LUTEUM and the PLACENTA. Progesterone acts on the UTERUS, the MAMMARY GLANDS and the BRAIN. It is required in EMBRYO IMPLANTATION; PREGNANCY maintenance, and the development of mammary tissue for MILK production. Progesterone, converted from PREGNENOLONE, also serves as an intermediate in the biosynthesis of GONADAL STEROID HORMONES and adrenal CORTICOSTEROIDS [MeSH].", 
"A dipeptide formed from glycine and L-cysteine residues [ChEBI].", 
"A naphthoquinone having a methyl substituent at the 2-position [ChEBI]. A synthetic naphthoquinone without the isoprenoid side chain and biological activity, but can be converted to active vitamin K2, menaquinone, after alkylation in vivo [MeSH].", 
"An anthracycline produced by Streptomyces galilaeus. It has potent antineoplastic activity [MeSH].", 
"A sugar acid derived from D-glucose in which both the aldehydic carbon atom and the carbon atom bearing the primary hydroxyl group are oxidized to carboxylic acid groups [MeSH].", 
"An optically active form of asparagine having D-configuration [ChEBI]. A non-essential amino acid that is involved in the metabolic control of cell functions in nerve and brain tissue. It is biosynthesized from ASPARTIC ACID and AMMONIA by asparagine synthetase. (From Concise Encyclopedia Biochemistry and Molecular Biology, 3rd ed) [MeSH].", 
"A trimethylxanthine in which the three methyl groups are located at positions 1, 3, and 7 [ChEBI]. A methylxanthine naturally occurring in some beverages and also used as a pharmacological agent. Caffeine's most notable pharmacological effect is as a central nervous system stimulant, increasing alertness and producing agitation. It also relaxes SMOOTH MUSCLE, stimulates CARDIAC MUSCLE, stimulates DIURESIS, and appears to be useful in the treatment of some types of headache. Several cellular actions of caffeine have been observed, but it is not entirely clear how each contributes to its pharmacological profile. Among the most important are inhibition of cyclic nucleotide PHOSPHODIESTERASES, antagonism of ADENOSINE RECEPTORS, and modulation of intracellular calcium handling [MeSH].", 
"A substituted phenothiazine in which the ring nitrogen at position 10 is attached to C-3 of an N,N-dimethylpropan-2-amine moiety [ChEBI]. A phenothiazine derivative with histamine H1-blocking, antimuscarinic, and sedative properties. It is used as an antiallergic, in pruritus, for motion sickness and sedation, and also in animals [MeSH].", 
"The 4-methanol form of VITAMIN B 6 which is converted to PYRIDOXAL PHOSPHATE which is a coenzyme for synthesis of amino acids, neurotransmitters (serotonin, norepinephrine), sphingolipids, aminolevulinic acid. Although pyridoxine and Vitamin B 6 are still frequently used as synonyms, especially by medical researchers, this practice is erroneous and sometimes misleading (EE Snell; Ann NY Acad Sci, vol 585 pg 1, 1990) [MeSH].", 
"An aminonucleoside antibiotic, derived from the Streptomyces alboniger bacterium, that causes premature chain termination during translation taking place in the ribosome [ChEBI]. A cinnamamido ADENOSINE found in STREPTOMYCES alboniger. It inhibits protein synthesis by binding to RNA. It is an antineoplastic and antitrypanosomal agent and is used in research as an inhibitor of protein synthesis [MeSH].", 
"A ribonucleoside composed of a molecule of adenine attached to a ribofuranose moiety via a beta-N(9)-glycosidic bond [ChEBI]. A nucleoside that is composed of adenine and d-ribose. Adenosine or adenosine derivatives play many important biological roles in addition to being components of DNA and RNA. Adenosine itself is a neurotransmitter [MeSH].", 
"A purine nucleoside in which hypoxanthine is attached to ribofuranose via a beta-N(9)-glycosidic bond [ChEBI]. A purine nucleoside that has hypoxanthine linked by the N9 nitrogen to the C1 carbon of ribose. It is an intermediate in the degradation of purines and purine nucleosides to uric acid and in pathways of purine salvage. It also occurs in the anticodon of certain transfer RNA molecules. (Dorland, 28th ed) [MeSH].", 
"A semisynthetic, first-generation cephalosporin antibiotic with acetoxymethyl and (2-thienylacetyl)nitrilo moieties at positions 3 and 7, respectively, of the core structure. Administered parenterally during surgery and to treat a wide spectrum of blood infections [ChEBI]. A cephalosporin antibiotic [MeSH].", 
