"A product formed from skin, white connective tissue, or bone COLLAGEN. It is used as a protein food adjuvant, plasma substitute, hemostatic, suspending agent in pharmaceutical preparations, and in the manufacturing of capsules and suppositories [MeSH].", 
"A polypeptide hormone produced and secreted by the pituitary gland comprising 39 amino acid residues coupled in a linear sequence. The N-terminal 24-amino acid segment is identical in all species and contains the adrenocorticotrophic activity. Corticotropin stimulates the cortex of the adrenal gland and boosts the synthesis of corticosteroids, mainly glucocorticoids but also sex steroids (androgens). It is used in the treatment of certain neurological disorders such as infantile spasms and multiple sclerosis, and diagnostically to investigate adrenocortical insufficiency [ChEBI]. An anterior pituitary hormone that stimulates the ADRENAL CORTEX and its production of CORTICOSTEROIDS. ACTH is a 39-amino acid polypeptide of which the N-terminal 24-amino acid segment is identical in all species and contains the adrenocorticotrophic activity. Upon further tissue-specific processing, ACTH can yield ALPHA-MSH and corticotrophin-like intermediate lobe peptide (CLIP) [MeSH].", 
"A lactogenic hormone secreted by the adenohypophysis (PITUITARY GLAND, ANTERIOR). It is a polypeptide of approximately 23 kD. Besides its major action on lactation, in some species prolactin exerts effects on reproduction, maternal behavior, fat metabolism, immunomodulation and osmoregulation. Prolactin receptors are present in the mammary gland, hypothalamus, liver, ovary, testis, and prostate [MeSH].", 
"A peptide hormone produced in the pancreas and involved in regulating the metabolism of carbohydrates (particularly glucose) and fats. Commonly thought of as a protein, it consists of two petide chains, one containing 21 amino acid residues and the other containing 30; the chains are joined together by 2 disulfide bonds. Recombinant insulin is identical to human insulin, but is synthesised by inserting the human insulin gene into E. coli, which then produces insulin for human use. It is used in the treatment of type I and type II diabetes [ChEBI]. A 51-amino acid pancreatic hormone that plays a major role in the regulation of glucose metabolism, directly by suppressing endogenous glucose production (GLYCOGENOLYSIS; GLUCONEOGENESIS) and indirectly by suppressing GLUCAGON secretion and LIPOLYSIS. Native insulin is a globular protein comprised of a zinc-coordinated hexamer. Each insulin monomer containing two chains, A (21 residues) and B (30 residues), linked by two disulfide bonds. Insulin is used as a drug to control insulin-dependent diabetes mellitus (DIABETES MELLITUS, TYPE 1) [MeSH].", 
